import React from 'react';
import '../App.css';
import { Container,Button,Row,Col } from "react-bootstrap";
// import {Button} from '@material-ui/core'
import logo from '../assets/image/logo.png';

export default function Welcome(){
    return(
        <div className="main">
        <Container fuild="xl" >
  <Row>
    <Col xl={12}><img src={logo} style={{height:250,width:250,marginLeft:450,marginTop:100}}/></Col>
    <Col xl={12}><h1 style={{fontSize:50,color:"#fff",fontFamily:'Sonsie One',marginLeft:300,}}>WELCOME TO</h1></Col>
    <Col><h4 style={{fontSize:40,color:"#fff",fontFamily:'Carter One',marginLeft:350}}>DIGITAL IMMUNITY</h4></Col>
    <Col> <h6 style={{fontSize:30,color:"#fff",fontFamily:'Carter One',letterSpacing:3,marginLeft:450}}>PASSPORT</h6></Col> 
    <Col xl={12}>
    <Button variant="outline-primary" style={{marginLeft:480,marginTop:50,marginBottom:20}}>Get Started</Button>
    </Col>
  </Row>
</Container>
</div>
)}
